 alignment algorithm to compare a query sequence to the reference \nindex and score the alignments between the two&amp;lt;/p&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;Algorithms: Kaiju uses the MEGAN algorithm for taxonomic classification, while Kraken2 uses a custom algorithm called &amp;amp;ldquo;k-mer counting.&amp;amp;rdquo; \nThe specific algorithm used can affect the speed and accuracy of the classification.&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Reference database: Kaiju and Kraken2 use different reference databases for taxonomic classification. \nKaiju uses a database called &amp;amp;ldquo;NINJA&amp;amp;rdquo; (Non-redundant Improved and Normalized Just-in-time Annotations), \nwhich includes annotations for a wide variety of organisms.\nKraken2 uses a database called &amp;amp;ldquo;Minikraken,&amp;amp;rdquo; \nwhich includes annotations for a more limited set of organisms but is more comprehensive for those organisms.&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;"},"id":"13902","type":"panel.models.markup.HTML"},{"attributes":{},"id":"13920","type":"Selection"},{"attributes":{"children":[{"id":"13833"},{"id":"13834"}],"margin":[0,0,0,0],"name":"Column03247","sizing_mode":"stretch_width"},"id":"13832","type":"Column"},{"attributes":{},"id":"13921","type":"UnionRenderers"},{"attributes":{},"id":"13860","type":"StringEditor"},{"attributes":{"editor":{"id":"13880"},"field":"last_level_cat","formatter":{"id":"13879"},"title":"last_level_cat","width":0},"id":"13881","type":"TableColumn"},{"attributes":{},"id":"13922","type":"Selection"},{"attributes":{"background":"#04c273","css_classes":["markdown"],"height":80,"margin":[10,10,10,10],"name":"Markdown03229","sizing_mode":"stretch_width","style":{"color":"white","font-size":"px20","padding":"10px","text-align":"left"},"text":"&amp;lt;h2&amp;gt;Alignment and Read statistics&amp;lt;/h2&amp;gt;\n&amp;lt;p&amp;gt;Reads were aligned to hg38 with botwtie2&amp;lt;/p&amp;gt;"},"id":"13808","type":"panel.models.markup.HTML"},
